import React from 'react';

import logoRed from '../../assets/images/logoRed.png';
import logoYellow from '../../assets/images/logoYellow.png';
import logoGreen from '../../assets/images/logoGreen.png';
import shakaBlack from '../../assets/images/shakaBlack.png';

class Loader extends React.Component {

    render() {
        return (
            <div>
                <div className="ml--28">
                    <img id="shaka" src={shakaBlack} className="shaka shakingShaka mt-88 absolute" alt="js" />
                </div>
                <div className="flexContainer">
                <div className="flex3Column height200" />
                <div className="flex3Column height200">
                    <img id="logo1" src={logoRed} className="z1 logo1 absolute logo height200 ml--100" alt="logoRed" />
                    <img id="logo2" src={logoYellow} className="z2 logo2 absolute logo height200 ml--100" alt="logoYellow" />
                    <img id="logo3" src={logoGreen} className="z3 logo3 absolute logo height200 ml--100" alt="logoGreen" />
                </div>
                <div className="flex3Column height200" /></div>
            </div>
        );
    };
}

export default Loader;
